message:
🇧🇷 | Segundo informações da jornalista Ana Flor, representantes do povo, como uma mulher, um indígena, um negro e uma pessoa com deficiência, vão passar a faixa presidencial a Lula.

@FeedBrasil na #PossePresidencial
Via GloboNews

🇧🇷 | Coincidência ou combinado?

Alckmin usa gravata vermelha, cor do PT, enquanto Lula está de gravata azul, cor do PSDB, antigo partido de Alckmin, pelo qual concorreu à presidência contra Lula, em 2006. 

@FeedBrasil na #PossePresidencial

🇧🇷 | É oficial!! Luiz Inácio Lula da Silva está empossado e é o presidente da República Federativa do Brasil! 

Lula governará o país até o dia 04 de janeiro de 2027. 

@FeedBrasil na #PossePresidencial

🇧🇷 | Lula adota tom conciliador em seu discurso de posse

“Não carregamos nenhum ânimo de revanche contra os que tentaram subjugar a Nação a seus desígnios pessoais e ideológicos (...)” 

@FeedBrasil na #PossePresidencial

🇧🇷 | Ao assinar o termo de posse, o presidente Lula conta a história sobre a caneta que ele está utilizando para assinar os papéis.

Lula ganhou a caneta, em 1989, de um piauiense e agora diz que está usando para homenagear o Piauí.

@FeedBrasil na #PossePresidencial

🇧🇷 | Lula cita Deus e proteção divina ao falar de liberdade religiosa:

“Sob a proteção de Deus, inauguro este mandato reafirmando que no Brasil a fé pode estar presente em todas as moradas, nos diversos templos, igrejas e cultos.” 

@FeedBrasil na #PossePresidencial

🇧🇷 | Bolsonaristas comemoram fake news sobre Exército impedir Lula de subir rampa

Ajoelhados e chorando, os manifestantes oraram e agradeceram pela “intervenção das Forças Armadas" do Exército

 @FeedBrasil

🇧🇷 | Rodrigo Pacheco diz que “Brasil ganha fôlego” com Lula presidente.

Presidente do Senado, Rodrigo Pacheco discursou durante a cerimônia de posse presidencial, neste domingo (1º/1), no Congresso Nacional.

@FeedBrasil na #PossePresidencial

🇧🇷🇵🇹 | Pacheco é criticado por alguns espectadores por se referir a Portugal como “Pátria Mãe do Brasil”. 

O presidente do Senado, no entanto, foi elogiado pelo tom conciliador do restante de seu discurso, em que citou direitos sociais, democracia e crescimento econômico.

@FeedBrasil na #PossePresidencial

🇧🇷 | Segundo Eduardo Bolsonaro, a falta de bandeiras do Brasil na posse de Lula seria uma prova de que o Brasil está se tornando “comunista”.

No entanto, haviam bandeiras do Brasil na posse presidencial.

@FeedBrasil
